import type { NextApiRequest, NextApiResponse } from 'next';

const ACCESS_TOKEN = process.env.CLICKSIGN_TOKEN_PROD;
const CLICK_BASE = process.env.CLICKSIGN_BASE_URL_PROD;
const CHAT_HOT_TOKEN = process.env.CHAT_HOT_TOKEN;

// Validação das variáveis de ambiente
if (!ACCESS_TOKEN || !CLICK_BASE) {
  console.error('Variáveis de ambiente do ClickSign não configuradas:', {
    ACCESS_TOKEN: !!ACCESS_TOKEN,
    CLICK_BASE: !!CLICK_BASE
  });
}

const base64 = ""

const TEMPLATE_PJ = "35219578-211c-440d-bd15-f4334ae046af"; // Substitua pela chave real do template PJ
const TEMPLATE_PF = "d173ae7f-3b6a-4e15-aa87-a52d2cc7032b"; // Substitua pela chave real do template PF

export default async function handler(req: NextApiRequest, res: NextApiResponse) {
  if (req.method !== 'POST') {
    return res.status(405).json({ error: 'Method not allowed' });
  }

  try {
    const { nome, email, cpf, telefone, cnpj, cep } = req.body;
    console.log('Recebido:', { nome, email, cpf, telefone });

    // 1. Criar envelope
    const envelopePayload = {
      data: {
        type: "envelopes",
        attributes: {
          name: "PARCEIROS",
          locale: "pt-BR",
          auto_close: true,
          remind_interval: "3",
          block_after_refusal: false
        }
      }
    };
    console.log('Criando envelope...');
    const envelopeResponse = await fetch(`${CLICK_BASE}/api/v3/envelopes?access_token=${ACCESS_TOKEN}`, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/vnd.api+json',
        'Accept': 'application/vnd.api+json'
      },
      body: JSON.stringify(envelopePayload)
    });
    const envelopeData: any = await envelopeResponse.json();
    console.log('Envelope response:', envelopeData);

    if (!envelopeData.data || !envelopeData.data.id) {
      console.error('Erro ao criar envelope:', envelopeData);
      return res.status(500).json({
        error: 'Erro ao criar envelope na Clicksign',
        details: envelopeData,
      });
    }

    const envelopeId = envelopeData.data.id;
    console.log("Envelope ID:", envelopeId);

    const isPJ = !!cnpj;
    const templateKey = isPJ ? TEMPLATE_PJ : TEMPLATE_PF;


    // 2. Adicionar documento do template ao envelope
    const documentPayload = {
      data: {
        type: "documents",
        attributes: {
          filename: "CONTRATO PARCEIROS.docx",
          template: {
            key: templateKey,
            data: {
              cpf: cpf,
              cnpj: isPJ ? cnpj : undefined,
              email: email,
              cep: cep
            }
          },
          metadata: {
            // aqui vão metadados opcionais, se necessário
          }
        }
      }
    };
    console.log('Adicionando documento ao envelope...');
    const documentResponse = await fetch(`${CLICK_BASE}/api/v3/envelopes/${envelopeId}/documents?access_token=${ACCESS_TOKEN}`, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/vnd.api+json',
        'Accept': 'application/vnd.api+json'
      },
      body: JSON.stringify(documentPayload)
    });
    const documentData: any = await documentResponse.json();
    console.log('Documento response:', documentData);
    console.log("Documento ID:", documentData.data?.id);

    if (!documentData.data || !documentData.data.id) {
      console.error('Erro ao adicionar documento:', documentData);
      return res.status(500).json({
        error: 'Erro ao adicionar documento ao envelope',
        details: documentData
      });
    }

    // 3. Criar signatário
    const signerPayload = {
      data: {
        type: "signers",
        attributes: {
          name: nome,
          email: email,
          phone_number: telefone,
          documentation: cpf,
        }
      }
    };
    console.log('Criando signatário...');
    const signerResponse = await fetch(`${CLICK_BASE}/api/v3/envelopes/${envelopeId}/signers?access_token=${ACCESS_TOKEN}`, {
      method: 'POST',
      headers: {
        'Authorization': `Token token=${ACCESS_TOKEN}`,
        'Content-Type': 'application/vnd.api+json',
        'Accept': 'application/vnd.api+json'
      },
      body: JSON.stringify(signerPayload)
    });
    const signerData: any = await signerResponse.json();
    console.log('Signatário response:', signerData);
    console.log("Signatário ID:", signerData.data?.id);

    if (!signerData.data || !signerData.data.id) {
      console.error('Erro ao criar signatário:', signerData);
      return res.status(500).json({
        error: 'Erro ao criar signatário na Clicksign',
        details: signerData
      });
    }

    const signerId = signerData.data.id;
    const documentId = documentData.data.id;

    const requirementSignPayload = {
      data: {
        type: "requirements",
        attributes: {
          action: "agree",
          role: "sign",
        },
        relationships: {
          signer: {
            data: {
              type: "signers",
              id: signerId
            }
          },
          document: {
            data: {
              type: "documents",
              id: documentId
            }
          }
        }
      }
    };
    console.log('Criando requisito de assinatura...');
    const reqSignResp = await fetch(
      `${CLICK_BASE}/api/v3/envelopes/${envelopeId}/requirements?access_token=${ACCESS_TOKEN}`,
      {
        method: 'POST',
        headers: {
          'Content-Type': 'application/vnd.api+json',
          'Accept': 'application/vnd.api+json'
        },
        body: JSON.stringify(requirementSignPayload)
      }
    );
    const reqSignData: any = await reqSignResp.json();
    console.log('Requisito de assinatura criado:', reqSignData);

    const requirementAuthPayload = {
      data: {
        type: "requirements",
        attributes: {
          action: "provide_evidence",
          auth: "email"
        },
        relationships: {
          signer: {
            data: {
              type: "signers",
              id: signerId
            }
          },
          document: {
            data: {
              type: "documents",
              id: documentId
            }
          }
        }
      }
    };
    console.log('Criando requirement de autenticação...');


    const reqAuthResp = await fetch(
      `${CLICK_BASE}/api/v3/envelopes/${envelopeId}/requirements?access_token=${ACCESS_TOKEN}`,
      {
        method: 'POST',
        headers: {
          'Content-Type': 'application/vnd.api+json',
          'Accept': 'application/vnd.api+json'
        },
        body: JSON.stringify(requirementAuthPayload)
      }
    );
    const reqAuthData: any = await reqAuthResp.json();
    console.log('Requirement de autenticação criado:', reqAuthData);


    const requirementPayload = {
      data: {
        type: "requirements",
        attributes: {
          action: "rubricate",
          pages: "10",
        },
        relationships: {
          signer: {
            data: { type: "signers", id: signerId }
          },
          document: {
            data: { type: "documents", id: documentId }
          }
        }
      }
    };
    await fetch(
      `${CLICK_BASE}/api/v3/envelopes/${envelopeId}/requirements?access_token=${ACCESS_TOKEN}`,
      {
        method: 'POST',
        headers: {
          'Content-Type': 'application/vnd.api+json',
          'Accept': 'application/vnd.api+json'
        },
        body: JSON.stringify(requirementPayload)
      }
    );

    // ===========================
    //  INCLUA AQUI OS LOGS ADICIONAIS
    // ===========================

    // 6a. Consultar o estado completo do envelope antes de enviar
    console.log('Consultando Envelope (GET) antes de enviar...');
    const envelopeGetResp = await fetch(
      `${CLICK_BASE}/api/v3/envelopes/${envelopeId}?access_token=${ACCESS_TOKEN}`,
      {
        method: 'GET',
        headers: {
          'Content-Type': 'application/vnd.api+json',
          'Accept': 'application/vnd.api+json'
        }
      }
    );
    const envelopeGetData: any = await envelopeGetResp.json();
    console.log('Envelope (GET) completo:', JSON.stringify(envelopeGetData, null, 2));

    console.log('Listando todos os requisitos antes de enviar...');
    const listReqsResp = await fetch(
      `${CLICK_BASE}/api/v3/envelopes/${envelopeId}/requirements?access_token=${ACCESS_TOKEN}`,
      {
        method: 'GET',
        headers: {
          'Content-Type': 'application/vnd.api+json',
          'Accept': 'application/vnd.api+json'
        }
      }
    );
    const listReqsData: any = await listReqsResp.json();
    console.log('Lista de requisitos (GET):', JSON.stringify(listReqsData, null, 2));

    // 6c. Listar todos os signatários (GET /signers)
    console.log('Listando todos os signatários antes de enviar...');
    const listSignersResp = await fetch(
      `${CLICK_BASE}/api/v3/envelopes/${envelopeId}/signers?access_token=${ACCESS_TOKEN}`,
      {
        method: 'GET',
        headers: {
          'Content-Type': 'application/vnd.api+json',
          'Accept': 'application/vnd.api+json'
        }
      }
    );
    const listSignersData: any = await listSignersResp.json();
    console.log('Lista de signatários (GET):', JSON.stringify(listSignersData, null, 2));

    console.log('Enviando envelope para assinatura...');
    const sendEnvelopeResponse = await fetch(`${CLICK_BASE}/api/v3/envelopes/${envelopeId}?access_token=${ACCESS_TOKEN}`, {
      method: 'PATCH',
      headers: {
        'Content-Type': 'application/vnd.api+json',
        'Accept': 'application/vnd.api+json'
      },
      body: JSON.stringify({
        data: {
          type: "envelopes",
          id: envelopeId,
          attributes: {
            status: "running"
          }
        }
      })
    });
    const sendEnvelopeData = await sendEnvelopeResponse.json();
    console.log('Envelope enviado:', sendEnvelopeData);


    let notificationStatus = null;
    try {
      const notifyResp = await fetch(
        `${CLICK_BASE}/api/v3/envelopes/${envelopeId}/signers/${signerId}/notifications`,
        {
          method: 'POST',
          headers: {
            'Content-Type': 'application/vnd.api+json',
            'Accept': 'application/vnd.api+json',
            'Authorization': `${ACCESS_TOKEN}`
          },
          body: JSON.stringify({
            data: {
              type: "notifications",
              attributes: {}
            }
          })
        }
      );
      notificationStatus = await notifyResp.json();
      console.log('Notificação de signatário enviada:', notificationStatus);
    } catch (err) {
      console.error('Erro ao notificar signatário na Clicksign:', err);
      notificationStatus = { error: String(err) };
    }

    function formatarTelefoneWhatsApp(telefone: string): string {
      const apenasNumeros = telefone.replace(/\D/g, '');
      const ddd = apenasNumeros.slice(0, 2);
      let numero = apenasNumeros.slice(2);
      if (numero.length === 8) {
        numero = '9' + numero;
      }
      return `55${ddd}${numero}`;
    }

    const mensagemWhatsapp = `Olá ${nome},
      
A *AMÉRICA FINANCEIRA* acaba de enviar um documento para a sua assinatura digital.
      
Acesse o seu email para visualizar e assinar seu documento.
      
Para sua segurança, não compartilhe este documento.`;

    try {
      await fetch('https://api2.chathot.com.br/api/messages/whatsmeow/sendTextPRO', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${CHAT_HOT_TOKEN}`,
        },
        body: JSON.stringify({
          number: formatarTelefoneWhatsApp(telefone),
          openTicket: 1,
          queueId: 438,
          body: mensagemWhatsapp,
        }),
      });
    } catch (err) {
      console.error('Erro ao enviar mensagem no WhatsApp:', err);
    }

    return res.status(200).json({
      success: true,
      envelope: envelopeData.data,
      document: documentData.data,
      signer: signerData.data,
    });
  } catch (err) {
    console.error('Erro inesperado:', err);
    return res.status(500).json({ error: 'Erro interno', details: String(err) });
  }
}